import React from 'react';
import Listing from '../components/listing';

const listings = props => {
  const listings = props.data.map((l_data, i) => {
    if (i % 3 === 0) {
      return (
        <div className='row'>
          <div key={i} className='col-1-of-3'>
            <Listing data={l_data} />
          </div>
        </div>
      );
    }
  });

  return <div>{listings}</div>;
};

export default listings;
